class Solution:
    def productExceptSelf(self, nums: list[int]) -> list[int]:

        ptr = 0
        i = 1
        length = len(nums)
        result = [1] * length
        product = 1

        while ptr < length:

            if i == length:
                result[ptr] = product
                product = 1
                i = 0
                ptr += 1
            
            if i != ptr :
                if nums[i] != 0:
                    product *= nums[i]
                else :
                    product = 0
                    i = length - 1
            
            i += 1
                
        return result




        
